import { Route, Switch } from "react-router-dom";
import MainNavigation from "./components/layout/MainNavigation";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <div>
      <MainNavigation />
      <Switch>
        <Route exact path="/">
          <HomePage />
        </Route>
        <Route path="/page">{/* page component */}</Route>
      </Switch>
    </div>
  );
}

export default App;
